import React, { Component } from 'react';

class Feed extends Component {

  render() {
    return (
      <div>
        Feed


        <div className="container">
          <div className="row">
            <div className="col-12 my-5 mx-auto">
              <img className="d-flex justify-content-center mx-auto" id="Logo" src="https://i.imgur.com/VooNS3J.png" alt=""></img>
            </div>
          </div>

<img className="d-flex justify-content-center mx-auto" id="Img" src="https://placekitten.com/500/300" alt=""></img>




        </div>
      </div>
    )
  }

}
export default Feed;
